CREATE DEFINER=`root`@`localhost` PROCEDURE `Actualizar_Detalle_Registro` (IN `_anioMedico` INT(11), IN `_empleado` INT(11), IN `_NDias` INT(11))   BEGIN
	DECLARE
		detalleExiste INT;
	
	SET detalleExiste = ( SELECT COUNT(*) FROM mrms_detalle_acumulados WHERE idEmpleado = _empleado AND añoAcumulado = _anioMedico );
	IF
		( detalleExiste = 1 ) THEN
			UPDATE mrms_detalle_acumulados 
			SET diasAcumulados = ( diasAcumulados + _NDias ) 
		WHERE
			idEmpleado = _empleado 
			AND añoAcumulado = _anioMedico;
		ELSE INSERT INTO mrms_detalle_acumulados ( idEmpleado, añoAcumulado, diasAcumulados )
		VALUES
			( _empleado, _anioMedico, _NDias );
		
	END IF;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `Anular_Licencia` (IN `_licencia` INT(11), IN `ndias` INT(11), IN `_usuarioAnu` INT(11), OUT `mensaje` VARCHAR(255))   BEGIN
	DECLARE
		anio INT;
	DECLARE
		mes INT;
	DECLARE
		empleadoId INT;
	DECLARE
		valida_Conteo INT;
	DECLARE
		mensajeAuditoria VARCHAR ( 100 );
	
	SET anio =(
		SELECT
			anioMedico 
		FROM
			mrms_licencias 
		WHERE
		idLicencia = _licencia);
	
	SET mes =(
		SELECT
			mesMedico 
		FROM
			mrms_licencias 
		WHERE
		idLicencia = _licencia);
	SET empleadoId =(
		SELECT
			empleado 
		FROM
			mrms_licencias 
		WHERE
		idLicencia = _licencia);
SET valida_Conteo = ( SELECT COUNT(*) FROM mrms_detalle_acumulados WHERE mrms_detalle_acumulados.idEmpleado = empleadoId AND `añoAcumulado` = anio );
	IF
		( valida_Conteo > 0 ) THEN
		IF
			( mes > 0 ) THEN
			UPDATE mrms_licencias 
				SET `status` = 2 
			WHERE
				idLicencia = _licencia;
			UPDATE mrms_detalle_acumulados 
			SET diasAcumulados = diasAcumulados - ndias 
			WHERE
				idEmpleado = empleadoId 
				AND `añoAcumulado` = anio;
			
			SET mensajeAuditoria = 'Anulación de licencia con modificación del acumulado';
			CALL Registrar_Auditoria ( _licencia, mensajeAuditoria, _usuarioAnu );
			
			SET mensaje = (
				SELECT
				IF
					((
							20 - mrms_detalle_acumulados.diasAcumulados 
							) > 0,
						CONCAT(
							"Le quedan ",(
								20 - mrms_detalle_acumulados.diasAcumulados 
							),
							" día(s) disponibles de licencia a ",
							mrms_empleados.nombresEmp,
							" ",
							mrms_empleados.apellidosPEmp,
							" ",
							mrms_empleados.apellidosMEmp,
							" de un Total Acumulado de : ",
							mrms_detalle_acumulados.diasAcumulados,
							" dia(s) del año ",
							mrms_detalle_acumulados.añoAcumulado,
							"." 
						),
						CONCAT(
							"No le quedan días disponibles de licencia a ",
							mrms_empleados.nombresEmp,
							" ",
							mrms_empleados.apellidosPEmp,
							" ",
							mrms_empleados.apellidosMEmp,
							" de un Total Acumulado de : ",
							mrms_detalle_acumulados.diasAcumulados,
							" dia(s) del año ",
							mrms_detalle_acumulados.añoAcumulado,
							"." 
						)) AS mensaje 
				FROM
					mrms_detalle_acumulados
					INNER JOIN mrms_empleados ON mrms_detalle_acumulados.idEmpleado = mrms_empleados.idEmpleado 
				WHERE
					mrms_detalle_acumulados.idEmpleado = empleadoId 
					AND `añoAcumulado` = anio 
				);
			ELSE 
			UPDATE mrms_licencias 
			SET `status` = 2 
			WHERE
				idLicencia = _licencia;
			
			SET mensajeAuditoria = 'Anulación de licencia sin modificación del acumulado';
			CALL Registrar_Auditoria ( _licencia, mensajeAuditoria, _usuarioAnu );
			
						SET mensaje = (
			SELECT
			IF
				((
						20 - mrms_detalle_acumulados.diasAcumulados 
						) > 0,
					CONCAT(
						"Le quedan ",(
							20 - mrms_detalle_acumulados.diasAcumulados 
						),
						" día(s) disponibles de licencia a ",
						mrms_empleados.nombresEmp,
						" ",
						mrms_empleados.apellidosPEmp,
						" ",
						mrms_empleados.apellidosMEmp,
						" de un Total Acumulado de : ",
						mrms_detalle_acumulados.diasAcumulados,
						" dia(s) del año ",
						mrms_detalle_acumulados.añoAcumulado,"." 
					),
					CONCAT(
						"No le quedan días disponibles de licencia a ",
						mrms_empleados.nombresEmp,
						" ",
						mrms_empleados.apellidosPEmp,
						" ",
						mrms_empleados.apellidosMEmp,
						" de un Total Acumulado de : ",
						mrms_detalle_acumulados.diasAcumulados,
						" dia(s) del año ",
						mrms_detalle_acumulados.añoAcumulado,"." 
					)) AS mensaje 
			FROM
				mrms_detalle_acumulados
				INNER JOIN mrms_empleados ON mrms_detalle_acumulados.idEmpleado = mrms_empleados.idEmpleado 
			WHERE
				mrms_detalle_acumulados.idEmpleado = empleadoId 
				AND `añoAcumulado` = anio 
			);
		END IF;
		ELSE 
			SET mensaje = '0';
	END IF;
	SELECT
		mensaje;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `Anular_SaludOcupacional` (IN `_idAis` INT(11), IN `_usuAnu` INT(11))   UPDATE mrms_aislamientos SET estadoAis = 0, usuAnu = _usuAnu WHERE idAis = _idAis$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `AuditoriaSOAnuladas` ()   SELECT
	mrms_aislamientos.correAis,
	mrms_usuarios.dni,
	CONCAT(mrms_usuarios.nombres,' ',mrms_usuarios.apellidos) AS empleado,
	mrms_usuarios.cuenta 
FROM
	mrms_aislamientos
	INNER JOIN mrms_usuarios ON mrms_aislamientos.usuAnu = mrms_usuarios.idUsuario 
WHERE
	usuReg != 1 ORDER BY correAis DESC$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `Buscar_Cargos` (IN `_termino` TEXT)   SELECT
	mrms_cargos.idCargo,
	CONCAT(mrms_cargos.codCargo," - ",mrms_cargos.descCargo) as cargodetalle
FROM
	mrms_cargos
	WHERE (mrms_cargos.codCargo LIKE CONCAT('%',_termino,'%') OR mrms_cargos.descCargo LIKE CONCAT('%',UPPER(_termino),'%'))
	ORDER BY idCargo$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `Buscar_Empleado` (IN `_termino` TEXT)   SELECT
	mrms_empleados.idEmpleado, 
	mrms_empleados.dniEmp, 
	mrms_empleados.nombresEmp, 
	mrms_empleados.apellidosPEmp,
	mrms_empleados.apellidosMEmp,  
	mrms_condicionlab.descCondicion, 
	mrms_cargos.descCargo
FROM
	mrms_empleados
	INNER JOIN
	mrms_condicionlab
	ON 
		mrms_empleados.condicionEmp = mrms_condicionlab.idCondicionLab
	INNER JOIN
	mrms_cargos
	ON 
		mrms_empleados.cargoEmp = mrms_cargos.idCargo
		WHERE (mrms_empleados.dniEmp LIKE CONCAT('%',_termino,'%') OR mrms_empleados.apellidosPEmp LIKE CONCAT('%',UPPER(_termino),'%')) AND estadoEmp > 0$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `Control_Maternidad_Anual` (IN `_anio` INT(11))   SELECT
	mrms_licencias.correlativoLic, 
	mrms_licencias.expAnterior, 
	mrms_empleados.dniEmp, 
	CONCAT( mrms_empleados.apellidosPEmp, " ", mrms_empleados.apellidosMEmp, " ", mrms_empleados.nombresEmp ) AS empleadoNA, 
	mrms_condicionlab.descCondicion, 
	mrms_meses.descMes, 
	date_format( mrms_licencias.fechaIngreso, '%d/%m/%Y' ) AS fechaIngreso, 
	date_format( mrms_licencias.fechaInicio, '%d/%m/%Y' ) AS fechaInicio, 
	date_format( mrms_licencias.fechaFin, '%d/%m/%Y' ) AS fechaFin, 
	mrms_licencias.NDias
FROM
	mrms_licencias
	INNER JOIN
	mrms_empleados
	ON 
		mrms_licencias.empleado = mrms_empleados.idEmpleado
	INNER JOIN
	mrms_condicionlab
	ON 
		mrms_empleados.condicionEmp = mrms_condicionlab.idCondicionLab
	INNER JOIN
	mrms_cargos
	ON 
		mrms_empleados.cargoEmp = mrms_cargos.idCargo
	INNER JOIN
	mrms_estlicencia
	ON 
		mrms_licencias.estadoLic = mrms_estlicencia.idEstLic
	INNER JOIN
	mrms_meses
	ON 
		mrms_licencias.mesMedico = mrms_meses.idMes
WHERE
	`status` <> 2 AND
	mesMedico <> 0 AND
	anioMedico = _anio AND
	NDias = 98
ORDER BY
	mesMedico ASC, 
	fechaIngreso ASC$$

