CREATE DEFINER=`root`@`localhost` PROCEDURE `Control_Personal_Licencias_Mas20` (IN `_mes` INT(11), IN `_anio` INT(11))   SELECT
	mrms_licencias.empleado,
	mrms_licencias.correlativoLic,
	mrms_licencias.expAnterior,
	mrms_empleados.dniEmp,
	CONCAT( mrms_empleados.apellidosPEmp, " ", mrms_empleados.apellidosMEmp, " ", mrms_empleados.nombresEmp ) AS empleadoNA,
	CONCAT( mrms_cargos.codCargo, "-", mrms_cargos.descCargo ) AS empleadoCar,
	mrms_condicionlab.descCondicion,
	date_format( mrms_licencias.fechaIngreso, '%d/%m/%Y' ) AS fechaIngreso,
	date_format( mrms_licencias.fechaInicio, '%d/%m/%Y' ) AS fechaInicio,
	date_format( mrms_licencias.fechaFin, '%d/%m/%Y' ) AS fechaFin,
	mrms_licencias.NDias,
	mrms_meses.descMes,
	mrms_empleados.sueldoEmp 
FROM
	mrms_licencias
	INNER JOIN mrms_empleados ON mrms_licencias.empleado = mrms_empleados.idEmpleado
	INNER JOIN mrms_meses ON mrms_licencias.mesMedico = mrms_meses.idMes
	INNER JOIN mrms_cargos ON mrms_empleados.cargoEmp = mrms_cargos.idCargo
	INNER JOIN mrms_condicionlab ON mrms_empleados.condicionEmp = mrms_condicionlab.idCondicionLab 
WHERE
	empleado IN (
	SELECT DISTINCTROW
		mrms_licencias.empleado 
	FROM
		mrms_licencias 
	WHERE
		mesMedico != 0 
		AND anioMedico = _anio 
		AND NDias != 98 
		AND `status` != 2 
		AND mesMedico = _mes
	) 
	AND empleado IN (
	SELECT DISTINCT
		mrms_licencias.empleado 
	FROM
		mrms_licencias
		INNER JOIN mrms_empleados ON mrms_licencias.empleado = mrms_empleados.idEmpleado 
	WHERE
		`status` <> 2 
		AND mesMedico <> 0 
		AND mesMedico <= _mes  AND NDias <> 98 AND anioMedico = _anio GROUP BY empleado HAVING SUM( NDias ) > 20 
	) 
	AND mesMedico <= _mes and anioMedico = _anio
ORDER BY
	mrms_condicionlab.idCondicionLab ASC,
	apellidosPEmp ASC,
	mesMedico ASC, fechaInicio ASC$$

