CREATE DEFINER=`root`@`localhost` PROCEDURE `Editar_Licencia` (IN `_idLicencia` INT(11), IN `_idUsuarioMod` INT(11), IN `_anioMedico` INT(11), IN `_mesMedico` INT(11), IN `_mesMedicoA` INT(11), IN `_estadoLic` INT(11), IN `_empleado` INT(11), IN `_fechaIngreso` DATE, IN `_fechaInicio` DATE, IN `_fechaFin` DATE, IN `_NDias` INT(11), IN `_NDiasA` INT(11), IN `_entidad` INT(11), IN `_rucEntidad` VARCHAR(11), IN `_nombEntidad` TEXT, IN `_cipMed` VARCHAR(20), IN `_nombresMed` VARCHAR(100), IN `_citt` VARCHAR(30), IN `_servicionAte` TEXT, IN `_diagnostico` TEXT, IN `_descDiagnostico` TEXT, IN `_tipDoc` INT(11), IN `_fechaDoc` DATE, IN `_nroDoc` VARCHAR(50), IN `_descripDoc` VARCHAR(100), IN `_observaciones` VARCHAR(200))   BEGIN
	UPDATE mrms_licencias 
		SET anioMedico = _anioMedico,
		mesMedico = _mesMedico,
		estadoLic = _estadoLic,
		empleado = _empleado,
		fechaIngreso = _fechaIngreso,
		fechaInicio = _fechaInicio,
		fechaFin = _fechaFin,
		NDias = _NDias,
		entidad = _entidad,
		rucEntidad = _rucEntidad,
		nombEntidad = _nombEntidad,
		cipMed = _cipMed,
		nombresMed = _nombresMed,
		citt = _citt,
		servicionAte = _servicionAte,
		diagnostico = _diagnostico,
		descDiagnostico = _descDiagnostico,
		tipDoc = _tipDoc,
		fechaDoc = _fechaDoc,
		nroDoc = _nroDoc,
		descripDoc = _descripDoc,
		observaciones = _observaciones 
		WHERE
			idLicencia = _idLicencia;
			CALL Actualizar_Detalle_Modificar(_anioMedico,_idLicencia,_empleado,_NDias,_NDiasA,_mesMedico,_mesMedicoA,_idUsuarioMod);
END$$

