CREATE DEFINER=`root`@`localhost` PROCEDURE `Grafico_LicenciasxPersonal` (IN `_anio` INT(11), IN `_personal` INT(11))   SELECT
	mrms_meses.descMes,
	SUM(NDias) AS acumuladoDias
FROM
	mrms_licencias
	INNER JOIN
	mrms_meses
	ON 
		mrms_licencias.mesMedico = mrms_meses.idMes
WHERE
	empleado = _personal AND
	anioMedico = _anio AND mesMedico != 0 AND `status` != 2
	GROUP BY
	empleado, 
	mesMedico$$

