CREATE DEFINER=`root`@`localhost` PROCEDURE `Kardex_Empleado_Datos` (IN `_empleado` INT(11))   SELECT
	mrms_empleados.dniEmp, 
	CONCAT(mrms_empleados.apellidosPEmp," ",mrms_empleados.apellidosMEmp," ",mrms_empleados.nombresEmp) as empleadoNA,
	CONCAT(mrms_cargos.codCargo,"-",mrms_cargos.descCargo) as empleadoCar, 
	mrms_condicionlab.descCondicion, 
	mrms_empleados.sueldoEmp, 
	mrms_detalle_acumulados.diasAcumulados,
	IF((20 - mrms_detalle_acumulados.diasAcumulados) > 0,20 - mrms_detalle_acumulados.diasAcumulados,0) as disponibles
FROM
	mrms_empleados
	INNER JOIN
	mrms_condicionlab
	ON 
		mrms_empleados.condicionEmp = mrms_condicionlab.idCondicionLab
	INNER JOIN
	mrms_cargos
	ON 
		mrms_empleados.cargoEmp = mrms_cargos.idCargo
	LEFT JOIN
	mrms_detalle_acumulados
	ON 
		mrms_empleados.idEmpleado = mrms_detalle_acumulados.idEmpleado
	WHERE mrms_empleados.idEmpleado = _empleado$$

