CREATE DEFINER=`root`@`localhost` PROCEDURE `ListarTotalDifEmpSub` (IN `_mes` INT(11), IN `_anio` INT(11), IN `_empleado` INT(11))   SELECT
	SUM( NDias ) AS total_acumulado,
	(SUM( NDias) - 20) as diferencia 
FROM
	mrms_licencias 
WHERE
	mesMedico <> 0 
	AND `status` <> 2 
	AND anioMedico = _anio 
	AND mesMedico <= _mes
	AND mrms_licencias.empleado = _empleado
GROUP BY
		empleado 
	HAVING
		SUM( NDias ) > 20$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `ListarWidgetsDash` (IN `_anio` INT(11))   SELECT
COUNT(*) AS nlicencias,
