CREATE DEFINER=`root`@`localhost` PROCEDURE `Ranking_Detallado_Licencias` (IN `_anio` INT(11))   SELECT
	mrms_empleados.idEmpleado, 
	mrms_empleados.dniEmp, 
	CONCAT( mrms_empleados.apellidosPEmp, " ", mrms_empleados.apellidosMEmp, " ", mrms_empleados.nombresEmp ) AS empleadoNA, 
	CONCAT( mrms_cargos.codCargo, "-", mrms_cargos.descCargo ) AS empleadoCar,
	mrms_condicionlab.descCondicion, 
	SUM(
	IF
	( mrms_licencias.mesMedico = 1, NDias, NULL )) AS ENER, 
	SUM(
	IF
	( mrms_licencias.mesMedico = 2, NDias, NULL )) AS FEBR, 
	SUM(
	IF
	( mrms_licencias.mesMedico = 3, NDias, NULL )) AS MARZ, 
	SUM(
	IF
	( mrms_licencias.mesMedico = 4, NDias, NULL )) AS ABRI, 
	SUM(
	IF
	( mrms_licencias.mesMedico = 5, NDias, NULL )) AS MAY, 
	SUM(
	IF
	( mrms_licencias.mesMedico = 6, NDias, NULL )) AS JUN, 
	SUM(
	IF
	( mrms_licencias.mesMedico = 7, NDias, NULL )) AS JUL, 
	SUM(
	IF
	( mrms_licencias.mesMedico = 8, NDias, NULL )) AS AGO, 
	SUM(
	IF
	( mrms_licencias.mesMedico = 9, NDias, NULL )) AS SETI, 
	SUM(
	IF
	( mrms_licencias.mesMedico = 10, NDias, NULL )) AS OCT, 
	SUM(
	IF
	( mrms_licencias.mesMedico = 11, NDias, NULL )) AS NOV, 
	SUM(
	IF
	( mrms_licencias.mesMedico = 12, NDias, NULL )) AS DIC, 
	SUM(NDias) AS TOTAL_DIAS
FROM
	mrms_licencias
	INNER JOIN
	mrms_empleados
	ON 
		mrms_licencias.empleado = mrms_empleados.idEmpleado
	INNER JOIN
	mrms_condicionlab
	ON 
		mrms_empleados.condicionEmp = mrms_condicionlab.idCondicionLab
	INNER JOIN
	mrms_cargos
	ON 
		mrms_empleados.cargoEmp = mrms_cargos.idCargo
WHERE
	mesMedico <> 0 AND
