CREATE DEFINER=`root`@`localhost` PROCEDURE `Reporte_Control_Personal` (IN `_anio` INT(11), IN `_mes` INT(11))  NO SQL IF _anio > 0 AND _mes > 0 THEN
		SELECT
	mrms_licencias.correlativoLic, 
	mrms_licencias.expAnterior, 
	mrms_empleados.dniEmp, 
	CONCAT( mrms_empleados.nombresEmp, " ", mrms_empleados.apellidosPEmp, " ", mrms_empleados.apellidosMEmp ) AS nombresEmpleado, 
	mrms_condicionlab.descCondicion, 
	date_format( mrms_licencias.fechaInicio, '%d/%m/%Y' ) AS fechaInicio, 
	date_format( mrms_licencias.fechaFin, '%d/%m/%Y' ) AS fechaFin, 
	mrms_licencias.NDias, 
	mrms_tipoentidad.descTipoEnt,
	mrms_cargos.descCargo
FROM
	mrms_licencias
	INNER JOIN
	mrms_empleados
	ON 
		mrms_licencias.empleado = mrms_empleados.idEmpleado
	INNER JOIN
	mrms_condicionlab
	ON 
		mrms_empleados.condicionEmp = mrms_condicionlab.idCondicionLab
	INNER JOIN
	mrms_tipoentidad
	ON 
		mrms_licencias.entidad = mrms_tipoentidad.idTipoEnt
	INNER JOIN
	mrms_cargos
	ON 
		mrms_empleados.cargoEmp = mrms_cargos.idCargo
WHERE
	`status` <> 2 AND
	mesMedico > 0 AND
	mesMedico = _mes AND
	anioMedico = _anio
ORDER BY
	fechaInicio ASC;
		ELSE 		
		SELECT
	mrms_licencias.correlativoLic, 
	mrms_licencias.expAnterior, 
	mrms_empleados.dniEmp, 
	CONCAT( mrms_empleados.nombresEmp, " ", mrms_empleados.apellidosPEmp, " ", mrms_empleados.apellidosMEmp ) AS nombresEmpleado, 
	mrms_condicionlab.descCondicion, 
	date_format( mrms_licencias.fechaInicio, '%d/%m/%Y' ) AS fechaInicio, 
	date_format( mrms_licencias.fechaFin, '%d/%m/%Y' ) AS fechaFin, 
	mrms_licencias.NDias, 
	mrms_tipoentidad.descTipoEnt,
	mrms_cargos.descCargo
FROM
	mrms_licencias
	INNER JOIN
	mrms_empleados
	ON 
		mrms_licencias.empleado = mrms_empleados.idEmpleado
	INNER JOIN
	mrms_condicionlab
	ON 
		mrms_empleados.condicionEmp = mrms_condicionlab.idCondicionLab
	INNER JOIN
	mrms_tipoentidad
	ON 
		mrms_licencias.entidad = mrms_tipoentidad.idTipoEnt
	INNER JOIN
	mrms_cargos
	ON 
		mrms_empleados.cargoEmp = mrms_cargos.idCargo
		WHERE
			`status` != 2 
			AND mesMedico > 0 
			AND mesMedico = MONTH (
			CURDATE()) 
			AND anioMedico = YEAR (
			CURDATE()) 
		ORDER BY
			fechaInicio ASC; 
		END IF$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `Reporte_LicenciasPendientes` (IN `_mes` INT(11), IN `_anio` INT(11))   IF _mes > 0 THEN
	SELECT
	mrms_licencias.correlativoLic,
	mrms_licencias.expAnterior,
	mrms_empleados.dniEmp,
	CONCAT( mrms_empleados.apellidosPEmp, " ", mrms_empleados.apellidosMEmp, " ", mrms_empleados.nombresEmp ) AS empleadoNA,
	mrms_condicionlab.descCondicion,
	mrms_licencias.fechaInicio,
	mrms_licencias.fechaFin,
	mrms_licencias.NDias,
	mrms_licencias.observaciones 
FROM
	mrms_licencias
	INNER JOIN mrms_empleados ON mrms_licencias.empleado = mrms_empleados.idEmpleado
	INNER JOIN mrms_condicionlab ON mrms_empleados.condicionEmp = mrms_condicionlab.idCondicionLab 
WHERE
	mesMedico <> 0 
	AND `status` <> 2 
	AND estadoLic = 2 
	AND anioMedico = _anio
	AND mesMedico = _mes
	ORDER BY idCondicionLab ASC,empleadoNA ASC, fechaInicio ASC;
ELSE
	SELECT
	mrms_licencias.correlativoLic,
	mrms_licencias.expAnterior,
	mrms_empleados.dniEmp,
	CONCAT( mrms_empleados.apellidosPEmp, " ", mrms_empleados.apellidosMEmp, " ", mrms_empleados.nombresEmp ) AS empleadoNA,
	mrms_condicionlab.descCondicion,
	mrms_licencias.fechaInicio,
	mrms_licencias.fechaFin,
	mrms_licencias.NDias,
	mrms_licencias.observaciones 
FROM
	mrms_licencias
	INNER JOIN mrms_empleados ON mrms_licencias.empleado = mrms_empleados.idEmpleado
	INNER JOIN mrms_condicionlab ON mrms_empleados.condicionEmp = mrms_condicionlab.idCondicionLab 
WHERE
	mesMedico <> 0 
	AND `status` <> 2 
	AND estadoLic = 2 
	AND anioMedico = _anio
	ORDER BY idCondicionLab ASC,empleadoNA ASC, fechaInicio ASC;
END IF$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `Retorna_Acumulado_Dias_Modificar` (IN `_empleado` INT(11), IN `_anioMedico` INT(11), OUT `mensaje` VARCHAR(255))   BEGIN
	DECLARE
		VALIDA_CONTEO INT;
	
	SET VALIDA_CONTEO = ( SELECT COUNT(*) FROM mrms_detalle_acumulados WHERE idEmpleado = _empleado AND `añoAcumulado` = _anioMedico );
	IF
		( VALIDA_CONTEO > 0 ) THEN
			
			SET mensaje = (
			SELECT
			IF
				((
						20 - mrms_detalle_acumulados.diasAcumulados 
						) > 0,
					CONCAT(
						"Le quedan ",(
							20 - mrms_detalle_acumulados.diasAcumulados 
						),
						" día(s) disponibles de licencia a ",
						mrms_empleados.nombresEmp,
						" ",
						mrms_empleados.apellidosPEmp,
						" ",
						mrms_empleados.apellidosMEmp,
						" de un Total Acumulado de : ",
						mrms_detalle_acumulados.diasAcumulados,
						" dia(s) del año ",
						mrms_detalle_acumulados.añoAcumulado,"." 
					),
					CONCAT(
						"No le quedan días disponibles de licencia a ",
						mrms_empleados.nombresEmp,
						" ",
						mrms_empleados.apellidosPEmp,
						" ",
						mrms_empleados.apellidosMEmp,
						" de un Total Acumulado de : ",
						mrms_detalle_acumulados.diasAcumulados,
						" dia(s) del año ",
						mrms_detalle_acumulados.añoAcumulado,"." 
					)) AS mensaje 
			FROM
				mrms_detalle_acumulados
				INNER JOIN mrms_empleados ON mrms_detalle_acumulados.idEmpleado = mrms_empleados.idEmpleado 
			WHERE
				mrms_empleados.idEmpleado = _empleado 
				AND `añoAcumulado` = _anioMedico 
			);
		ELSE 
			SET mensaje = '0';
		
	END IF;
	SELECT
		mensaje;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `Retorna_Correlativo_Dias` (IN `_empleado` INT(11), IN `_autogenerado` VARCHAR(50), IN `_anio` INT(11), OUT `mensaje` VARCHAR(255))   BEGIN
DECLARE VALIDA_CONTEO INT;

SET VALIDA_CONTEO = ( SELECT COUNT(*) FROM mrms_licencias WHERE empleado = _empleado AND autogenerado = _autogenerado AND anioMedico = _anio);
IF
	( VALIDA_CONTEO > 0 ) THEN
		
		SET mensaje = (
		SELECT
			CONCAT(
				"Se ha generado la solicitud N° ",
				mrms_licencias.correlativoLic," de ",mrms_licencias.NDias," dia(s) ",
				", para ",(
				CONCAT( mrms_empleados.nombresEmp, " ", mrms_empleados.apellidosPEmp, " ", mrms_empleados.apellidosMEmp,". " )),(
				IF
				(( 20 - mrms_detalle_acumulados.diasAcumulados ) > 0, CONCAT( "Le quedan ",( 20 - mrms_detalle_acumulados.diasAcumulados ), " día(s) disponibles de licencia " ), CONCAT("No le quedan días disponibles de licencia para el año ",mrms_detalle_acumulados.añoAcumulado) ))," de un Total Acumulado de : ",mrms_detalle_acumulados.diasAcumulados," dia(s). del año ",mrms_detalle_acumulados.añoAcumulado) AS mensaje 
		FROM
			mrms_licencias
			INNER JOIN mrms_detalle_acumulados ON mrms_licencias.empleado = mrms_detalle_acumulados.idEmpleado
			INNER JOIN mrms_empleados ON mrms_licencias.empleado = mrms_empleados.idEmpleado 
		WHERE
			empleado = _empleado 
		AND autogenerado = _autogenerado AND `añoAcumulado` = _anio);
	ELSE 
		SET mensaje = '0';
END IF;
SELECT
	mensaje;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `Retorna_Correlativo_SaludOcupa` (IN `_empleado` INT(11), IN `_autogenerado` VARCHAR(50), OUT `mensaje` VARCHAR(255))   BEGIN
DECLARE VALIDA_CONTEO INT;

SET VALIDA_CONTEO = ( SELECT COUNT(*) FROM mrms_aislamientos WHERE empleado = _empleado AND autogenerado = _autogenerado );
IF
	( VALIDA_CONTEO > 0 ) THEN
		
		SET mensaje = (SELECT
			CONCAT(
				"Se ha generado la solicitud N° ",mrms_aislamientos.correAis," para ", (CONCAT(mrms_empleados.nombresEmp, " ", mrms_empleados.apellidosPEmp, " ", mrms_empleados.apellidosMEmp,". "))) AS mensaje 
		FROM
			mrms_aislamientos
			INNER JOIN mrms_empleados ON mrms_aislamientos.empleado = mrms_empleados.idEmpleado 
		WHERE
			empleado = _empleado
		AND autogenerado = _autogenerado);
	ELSE 
		SET mensaje = '0';
END IF;
SELECT
	mensaje;
END$$

