DELIMITER $$
CREATE TRIGGER `GENERAR_CORRELATIVO_AISLAMIENTO` BEFORE INSERT ON `mrms_aislamientos` FOR EACH ROW BEGIN
    DECLARE cont1 int default 0;
    DECLARE anio text;
    set anio = (SELECT YEAR(CURDATE()));
    SET cont1= (SELECT count(*) FROM mrms_aislamientos WHERE year(fechaRegAis) = year(now()));
		
    IF (cont1 < 1) THEN
    SET NEW.correAis = CONCAT('SO-',anio,'-', LPAD(cont1 + 1, 3, '0'));
    ELSE
    SET NEW.correAis = CONCAT('SO-',anio,'-', LPAD(cont1 + 1, 3, '0'));
    END IF;
END
$$
