--
-- Disparadores `mrms_licencias`
--
DELIMITER $$
CREATE TRIGGER `GENERAR_CORRELATIVO_LICENCIA` BEFORE INSERT ON `mrms_licencias` FOR EACH ROW BEGIN
    DECLARE cont1 int default 0;
    DECLARE anio text;
    set anio = (SELECT YEAR(CURDATE()));
    SET cont1= (SELECT count(*) FROM mrms_licencias WHERE year(fechaRegistro) = year(now()));
    IF (cont1 < 1) THEN
    SET NEW.correlativoLic = CONCAT('SDM-',anio,'-', LPAD(cont1 + 1, 6, '0'));
    ELSE
    SET NEW.correlativoLic = CONCAT('SDM-',anio,'-', LPAD(cont1 + 1, 6, '0'));
    END IF;
END
$$
DELIMITER ;

